import Post from "../post/Post";
import "./posts.css";

export default function Posts({ posts, isAdmin, user }) {
  function renderPosts()
  {
     if(user !== null)
     {
      if(isAdmin == 1)
      {
       return (
        posts.map((p) => (
          <Post post={p} />
        ))
      );
      }
      else{
        let userPosts  = posts.filter( p => p.username == user.user.username);
        return (
          userPosts.map((p) => (
          <Post post={p} />
        ))
       );
      }
    }
  }
  return (
    <div className="posts">
     {renderPosts()}
    </div>
  );
}
